import React from 'react'
import styled from "styled-components";
import Logo from "../assets/logo.png";


const Home = () => {
  return (
    <>
        <Container>
            <div className="nav">
                <img src={Logo} alt="logo" />
            </div>
            

        </Container>
    </>
  )
}

export default Home;

const Container = styled.div`
.nav{
    
}
img {
    height: 2rem;
  }

`;
